import React from 'react';
import { MdOutlineTimer } from 'react-icons/md';

const PaymentUI = ({ amount, handleIntentPay, loading, types }) => {
  return (
    <section className="p-6 bg-gray-100 rounded-lg shadow-md max-w-md mx-auto">
      {/* Header Section */}
      <div className="flex justify-between items-center mb-6">
        <p className="text-lg font-semibold">Payment Time Left</p>
        <div className="flex items-center">
          <MdOutlineTimer size={24} className="text-black" />
          <p className="ml-2 text-lg font-bold text-black" id="bank-timer">
            00:10:00
          </p>
        </div>
      </div>

      {/* Amount Section */}
      <div className="bg-white p-5 rounded-lg">
        <div className="flex justify-between items-center mb-4">
          <p className="text-base font-medium">Amount:</p>
          <p className="text-xl font-bold text-blue-500">₹{amount}</p>
        </div>
        <hr className="mb-4" />

        {/* Payment Options */}
        <div className="flex justify-around mb-5">
          <PaymentButton
            label="Google Pay"
            icon={<GooglePayIcon />}
            onClick={() => handleIntentPay(types.G_PAY)}
            loading={loading === types.G_PAY}
          />
          <PaymentButton
            label="PhonePe"
            icon={<PhonePeIcon />}
            onClick={() => handleIntentPay(types.PHONE_PE)}
            loading={loading === types.PHONE_PE}
          />
        </div>
        <div className="flex justify-around">
          <PaymentButton
            label="Paytm"
            icon={<PaytmIcon />}
            onClick={() => handleIntentPay(types.PAY_TM)}
            loading={loading === types.PAY_TM}
          />
          <PaymentButton
            label="BHIM UPI"
            icon={<BhimIcon />}
            onClick={() => handleIntentPay(types.BHIM)}
            loading={loading === types.BHIM}
          />
        </div>
      </div>
    </section>
  );
};

const PaymentButton = ({ label, icon, onClick, loading }) => (
  <button
    className={`flex items-center justify-center w-36 h-16 bg-gray-50 border border-gray-300 rounded-lg text-sm font-medium gap-2 hover:bg-gray-200 ${
      loading ? 'opacity-50 cursor-not-allowed' : ''
    }`}
    onClick={onClick}
    disabled={loading}
  >
    {icon}
    {label}
  </button>
);

// Custom Icons (Placeholder SVGs can be replaced with actual icons)
const GooglePayIcon = () => (
  <svg
    width="24"
    height="24"
    viewBox="0 0 48 48"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <circle cx="24" cy="24" r="24" fill="#4285F4" />
    <text x="24" y="30" textAnchor="middle" fill="white" fontSize="18" fontWeight="bold">
      G
    </text>
  </svg>
);

const PhonePeIcon = () => (
  <svg
    width="24"
    height="24"
    viewBox="0 0 48 48"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <circle cx="24" cy="24" r="24" fill="#4527A0" />
    <text x="24" y="30" textAnchor="middle" fill="white" fontSize="18" fontWeight="bold">
      P
    </text>
  </svg>
);

const PaytmIcon = () => (
  <svg
    width="24"
    height="24"
    viewBox="0 0 48 48"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <circle cx="24" cy="24" r="24" fill="#0D47A1" />
    <text x="24" y="30" textAnchor="middle" fill="white" fontSize="18" fontWeight="bold">
      ₹
    </text>
  </svg>
);

const BhimIcon = () => (
  <svg
    width="24"
    height="24"
    viewBox="0 0 48 48"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <circle cx="24" cy="24" r="24" fill="#21AD64" />
    <text x="24" y="30" textAnchor="middle" fill="white" fontSize="18" fontWeight="bold">
      U
    </text>
  </svg>
);

export default PaymentUI;
